import React from 'react';
import './menu.css';
import MenuRightItems from './menuRight/menuRightItems';
import MenuLeftItems from './menuLeft/menuLeftItems';


class Menu extends React.Component{
  constructor(props){
    super(props)
  }
  render(){
    return(
      <div class="topmenu col-13">
        <nav className="navbar navbar-expand-xl">
          <MenuLeftItems menuleft={this.props.menu.MenuLeft}/>
          <MenuRightItems  menuright={this.props.menu.MenuRight}/>
        </nav>
      </div>
    )
  }
}



export default Menu
